// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

interface icounter {
    function count() external view returns (uint);
    function increment() external;
}

contract CounterA {
    uint public count;

    function increment() external {
        count += 1;
    }

    function getCount() external view returns (uint) {
        return count;
    }
}

contract CounterB {
    uint public count;

    function increment() external {
        count += 2;
    }

    function getCount() external view returns (uint) {
        return count;
    }
}

contract CounterManager {
    function incrementCounter(icounter _counter) external {
        _counter.increment();
    }

    function getCount(icounter _counter) external view returns (uint) {
        return _counter.count();
    }
}

contract MainContract {
    CounterA counterA;
    CounterB counterB;
    CounterManager manager;

    constructor() {
        counterA = new CounterA();
        counterB = new CounterB();
        manager = new CounterManager();
    }

    function interactWithCounters() external {
        manager.incrementCounter(icounter(address(counterA)));
        manager.incrementCounter(icounter(address(counterB)));

        uint countA = manager.getCount(icounter(address(counterA)));
        uint countB = manager.getCount(icounter(address(counterB)));

        // Do something with countA and countB
    }
}

